// ***********************************************************************
// Typedefs
// ***********************************************************************

typedef struct
{
    uint32_t min;
    uint32_t mid;
    uint32_t max;
}POD_CHANNEL;

typedef struct
{
    uint16_t min;
    uint16_t mid;
    uint16_t max;
}POD_SERVO;

typedef struct
{
    unsigned char PODs_No;
    unsigned char PODs_Linked;
    unsigned char TurningRange;
    unsigned char Expo;
    unsigned char MaxSpeed;
    unsigned char SpeedLimit;
    unsigned int  RotSpeed;
    unsigned char ControlMode;
    unsigned char DO_Channel;           //switching channel
    unsigned char DO_Status;            //switching channel
    unsigned char StatusLED1;           //DO1-16
    unsigned char StatusLED2;           //DO1-16
    unsigned char StatusLED3;           //DO1-16
    unsigned char Sticktype;
}POD_MODE;

typedef struct
{
    signed int StepsTo0;
    signed int StepsFullCircle;
    signed int Steps_Set;
    signed int Steps_Is;
    signed int Speed_Set;
    signed int podStepRun;
    signed int podStepDir;
    float      StepAngle;
}POD_STEPPER;

typedef struct
{
    uint16_t StepsTo0;
    uint16_t StepsFullCircle;
    uint16_t Steps_Set;
    uint16_t Steps_Is;
    uint16_t Speed_Set;
    uint16_t podStepRun;
    uint16_t podStepDir;
    float      StepAngle;
}eePOD_STEPPER;


typedef unsigned char	u8;

